import React from "react";
import {
  Nav,
  NavItem
} from 'reactstrap';
import { NavLink } from 'react-router-dom';
import styled from 'styled-components';

const OrderPageHeader = () => {

  const HeaderRootStyle  = styled.div`
  background:#DC143C;
  height:20vh;
`
  const Main =styled.div`
  width: 60vw;  
  margin: auto;
  display: flex;
  flex-direction: column;
  `
  const H1 = styled.div`
  flex-grow: 1;
  text-align: center;
  padding-top: 1rem;
  font-family: 'Anton',cursive;
  font-size: 2.5rem;
  color: white;
  `

return (
<HeaderRootStyle>
  <Main>
    <H1>Teknolojik Yemekler</H1>
    <Nav pills>
      <NavItem>
        <NavLink to="/">Anasayfa-</NavLink>
      </NavItem>
      <NavItem>
        <NavLink href="#">Seçenekler</NavLink>
      </NavItem>
      <NavItem>
        <NavLink disabled href="#">Sipariş Oluştur</NavLink>
      </NavItem>
    </Nav>
  </Main>
</HeaderRootStyle>


)
}

export default OrderPageHeader;
